import React from 'react'
import Error from '../../images/errorgif.gif'
import { ErrorContainerPage, Container, Title, ImgError } from '../ErrorPage/styled'


export const ErrorPage = () => {
    return (
        <ErrorContainerPage>
            <Container>
            <Title>Ops.! ALGO DEU ERRADO!!</Title>
            <ImgError src={Error} />
            </Container>
        </ErrorContainerPage>
    )
}
